To depend on a library located in a git repository, the minimum information you need to specify is the location of the repository with the git key: [dependencies]
regex = { git = "https://github.com/rust-lang/regex.git" } Cargo fetches the git repository at that location and traverses the file tree to find Cargo.toml file for the requested crate anywhere inside the git repository. For example, regex-lite and regex-syntax are members of rust-lang/regex repo and can be referred to by the repo's root URL (https://github.com/rust-lang/regex.git) regardless of where in the file tree they reside. regex-lite = { git = "https://github.com/rust-lang/regex.git" }
regex-syntax = { git = "https://github.com/rust-lang/regex.git" } The above rule does not apply to path dependencies .

