fn main() { updated_crate::foo(); // Error: cannot find function `foo`
} This includes adding any sort of cfg attribute which can change which items or behavior is available based on conditional compilation . Mitigating strategies: Mark items to be removed as deprecated , and then remove them at a later date in a SemVer-breaking release. Mark renamed items as deprecated , and use a pub use item to re-export to the old name.

