It is a breaking change to change the alignment, layout, or size of a type that was previously well-defined. In general, types that use the the default representation do not have a well-defined alignment, layout, or size. The compiler is free to alter the alignment, layout, or size, so code should not make any assumptions about it. Note : It may be possible for external crates to break if they make assumptions about the alignment, layout, or size of a type even if it is not well-defined. This is not considered a SemVer breaking change since those assumptions should not be made. Some examples of changes that are not a breaking change are (assuming no other rules in this guide are violated): Adding, removing, reordering, or changing fields of a default representation struct, union, or enum in such a way that the change follows the other rules in this guide (for example, using non_exhaustive to allow those changes, or changes to private fields that are already private). See struct-add-private-field-when-public , struct-add-public-field-when-no-private , struct-private-fields-with-private , enum-fields-new . Adding variants to a default representation enum, if the enum uses non_exhaustive. This may change the alignment or size of the enumeration, but those are not well-defined. See enum-variant-new . Adding, removing, reordering, or changing private fields of a repr(C) struct, union, or enum, following the other rules in this guide (for example, using non_exhaustive, or adding private fields when other private fields already exist). See repr-c-private-change . Adding variants to a repr(C) enum, if the enum uses non_exhaustive. See repr-c-enum-variant-new . Adding repr(C) to a default representation struct, union, or enum. See repr-c-add . Adding repr(<int>) primitive representation to an enum. See repr-int-enum-add . Adding repr(transparent) to a default representation struct or enum. See repr-transparent-add . Types that use the repr attribute can be said to have an alignment and layout that is defined in some way that code may make some assumptions about that may break as a result of changing that type. In some cases, types with a repr attribute may not have an alignment, layout, or size that is well-defined. In these cases, it may be safe to make changes to the types, though care should be exercised. For example, types with private fields that do not otherwise document their alignment, layout, or size guarantees cannot be relied upon by external crates since the public API does not fully define the alignment, layout, or size of the type. A common example where a type with private fields is well-defined is a type with a single private field with a generic type, using repr(transparent), and the prose of the documentation discusses that it is transparent to the generic type. For example, see UnsafeCell . Some examples of breaking changes are: Adding repr(packed) to a struct or union. See repr-packed-add . Adding repr(align) to a struct, union, or enum. See repr-align-add . Removing repr(packed) from a struct or union. See repr-packed-remove . Changing the value N of repr(packed(N)) if that changes the alignment or layout. See repr-packed-n-change . Changing the value N of repr(align(N)) if that changes the alignment. See repr-align-n-change . Removing repr(align) from a struct, union, or enum. See repr-align-remove . Changing the order of public fields of a repr(C) type. See repr-c-shuffle . Removing repr(C) from a struct, union, or enum. See repr-c-remove . Removing repr(<int>) from an enum. See repr-int-enum-remove . Changing the primitive representation of a repr(<int>) enum. See repr-int-enum-change . Removing repr(transparent) from a struct or enum. See repr-transparent-remove . Minor: repr(C) add, remove, or change a private field It is usually safe to add, remove, or change a private field of a repr(C) struct, union, or enum, assuming it follows the other guidelines in this guide (see struct-add-private-field-when-public , struct-add-public-field-when-no-private , struct-private-fields-with-private , enum-fields-new ). For example, adding private fields can only be done if there are already other private fields, or it is non_exhaustive. Public fields may be added if there are private fields, or it is non_exhaustive, and the addition does not alter the layout of the other fields. However, this may change the size and alignment of the type. Care should be taken if the size or alignment changes. Code should not make assumptions about the size or alignment of types with private fields or non_exhaustive unless it has a documented size or alignment. // MINOR CHANGE ///////////////////////////////////////////////////////////
// Before
#[derive(Default)]
#[repr(C)]
pub struct Example { pub f1: i32, f2: i32, // a private field
} ///////////////////////////////////////////////////////////
// After
#[derive(Default)]
#[repr(C)]
pub struct Example { pub f1: i32, f2: i32, f3: i32, // a new field
} ///////////////////////////////////////////////////////////
// Example use of the library that will safely work.
fn main() { // NOTE: Users should not make assumptions about the size or alignment // since they are not documented. let f = updated_crate::Example::default();
} Minor: repr(C) add enum variant It is usually safe to add variants to a repr(C) enum, if the enum uses non_exhaustive. See enum-variant-new for more discussion. Note that this may be a breaking change since it changes the size and alignment of the type. See repr-c-private-change for similar concerns. // MINOR CHANGE ///////////////////////////////////////////////////////////
// Before
#[repr(C)]
#[non_exhaustive]
pub enum Example { Variant1 { f1: i16 }, Variant2 { f1: i32 },
} ///////////////////////////////////////////////////////////
// After
#[repr(C)]
#[non_exhaustive]
pub enum Example { Variant1 { f1: i16 }, Variant2 { f1: i32 }, Variant3 { f1: i64 }, // added
} ///////////////////////////////////////////////////////////
// Example use of the library that will safely work.
fn main() { // NOTE: Users should not make assumptions about the size or alignment // since they are not specified. For example, this raised the size from 8 // to 16 bytes. let f = updated_crate::Example::Variant2 { f1: 123 };
} Minor: Adding repr(C) to a default representation It is safe to add repr(C) to a struct, union, or enum with the default representation . This is safe because users should not make assumptions about the alignment, layout, or size of types with the default representation. // MINOR CHANGE ///////////////////////////////////////////////////////////
// Before
