} Minor: Adding repr(<int>) to an enum It is safe to add repr(<int>) primitive representation to an enum with the default representation . This is safe because users should not make assumptions about the alignment, layout, or size of an enum with the default representation. // MINOR CHANGE ///////////////////////////////////////////////////////////
// Before
