} Minor: Adding repr(transparent) to a default representation struct or enum It is safe to add repr(transparent) to a struct or enum with the default representation . This is safe because users should not make assumptions about the alignment, layout, or size of a struct or enum with the default representation. // MINOR CHANGE ///////////////////////////////////////////////////////////
// Before
#[derive(Default)]
pub struct Example<T>(T); ///////////////////////////////////////////////////////////
// After
#[derive(Default)]
#[repr(transparent)] // added
pub struct Example<T>(T); ///////////////////////////////////////////////////////////
