fn main() { let x = updated_crate::Example::<i32>::default();
} Major: Adding repr(packed) to a struct or union It is a breaking change to add repr(packed) to a struct or union. Making a type repr(packed) makes changes that can break code, such as being invalid to take a reference to a field, or causing truncation of disjoint closure captures. // MAJOR CHANGE ///////////////////////////////////////////////////////////
