fn main() { let mut f = updated_crate::Example(123, 456); let c = || { // Without repr(packed), the closure precisely captures `&f.0`. // With repr(packed), the closure captures `&f` to avoid undefined behavior. let a = f.0; }; f.1 = 789; // Error: cannot assign to `f.1` because it is borrowed c();
} Major: Adding repr(align) to a struct, union, or enum It is a breaking change to add repr(align) to a struct, union, or enum. Making a type repr(align) would break any use of that type in a repr(packed) type because that combination is not allowed. // MAJOR CHANGE ///////////////////////////////////////////////////////////
// Before
pub struct Aligned { pub a: i32,
} ///////////////////////////////////////////////////////////
// After
