pub struct Packed { // Error: packed type cannot transitively contain a `#[repr(align)]` type f1: Aligned,
} fn main() { let p = Packed { f1: Aligned { a: 123 }, };
} Major: Removing repr(packed) from a struct or union It is a breaking change to remove repr(packed) from a struct or union. This may change the alignment or layout that extern crates are relying on. If any fields are public, then removing repr(packed) may change the way disjoint closure captures work. In some cases, this can cause code to break, similar to those outlined in the edition guide . // MAJOR CHANGE ///////////////////////////////////////////////////////////
// Before
