} // MAJOR CHANGE ///////////////////////////////////////////////////////////
// Before
#[repr(C, packed)]
pub struct Packed { pub a: *mut i32, pub b: i32,
}
unsafe impl Send for Packed {} ///////////////////////////////////////////////////////////
