Artifact-dependencies adds the following keys to a dependency declaration in Cargo.toml: artifact --- This specifies the Cargo Target to build. Normally without this field, Cargo will only build the [lib] target from a dependency. This field allows specifying which target will be built, and made available as a binary at build time: "bin" --- Compiled executable binaries, corresponding to all of the [[bin]] sections in the dependency's manifest. "bin:<bin-name>" --- Compiled executable binary, corresponding to a specific binary target specified by the given <bin-name>. "cdylib" --- A C-compatible dynamic library, corresponding to a [lib] section with crate-type = ["cdylib"] in the dependency's manifest. "staticlib" --- A C-compatible static library, corresponding to a [lib] section with crate-type = ["staticlib"] in the dependency's manifest. The artifact value can be a string, or it can be an array of strings to specify multiple targets. Example: [dependencies]
bar = { version = "1.0", artifact = "staticlib" }
zoo = { version = "1.0", artifact = ["bin:cat", "bin:dog"]} lib --- This is a Boolean value which indicates whether or not to also build the dependency's library as a normal Rust lib dependency. This field can only be specified when artifact is specified. The default for this field is false when artifact is specified. If this is set to true, then the dependency's [lib] target will also be built for the platform target the declaring package is being built for. This allows the package to use the dependency from Rust code like a normal dependency in addition to an artifact dependency. Example: [dependencies]
bar = { version = "1.0", artifact = "bin", lib = true } target --- The platform target to build the dependency for. This field can only be specified when artifact is specified. The default if this is not specified depends on the dependency kind. For build dependencies, it will be built for the host target. For all other dependencies, it will be built for the same targets the declaring package is built for. For a build dependency, this can also take the special value of "target" which means to build the dependency for the same targets that the package is being built for. [build-dependencies]
bar = { version = "1.0", artifact = "cdylib", target = "wasm32-unknown-unknown"}
same-target = { version = "1.0", artifact = "bin", target = "target" }

